"use strict";
Page({
    data: {
        name: '',
        min: 0,
        max: 0,
    },
    onLoad: function (options) {
        wx.setNavigationBarTitle({ title: '参数限值' + options.name });
        this.setData({
            name: options.name,
            min: Number(options.min),
            max: Number(options.max)
        });
    },
    minonChange(event) {
        const max = this.data.max;
        const min = event.detail;
        this.setData({
            min,
            max: min >= max ? Number(min) + 1 : max
        });
    },
    maxonChange(event) {
        this.setData({
            max: event.detail
        });
    },
    submit() {
        const events = this.getOpenerEventChannel();
        events.emit("modifyThreshold", this.data);
        wx.navigateBack();
    },
    onReady: function () {
    },
    onShow: function () {
    },
    onHide: function () {
    },
    onUnload: function () {
    },
    onPullDownRefresh: function () {
    },
    onReachBottom: function () {
    },
    onShareAppMessage: function () {
    }
});
